import React from 'react';
import { BrowserRouter as Router, Route, Link  } from 'react-router-dom';
import App from './App';
import App2 from './pages/App2';

const Routes = () => (
    <Router>
            <Route exact path="/" component={App} />
            <Route path="/App2" component={App2} />
    </Router>
);

export default Routes;
